import React from "react";
import * as S from './styles'

import filter from '../../assets/filter.png'

function FilterCard({ title }) {
    return (
        <S.Container>
            <img src={title} alt="filtro" />
            <span>Todos</span>
        </S.Container>
    )
}

export default FilterCard;
